# SMART CONTRACTS
USDC_E = Web3.to_checksum_address("0x2791Bca1f2de4661ED88A30C99A7a9449Aa84174")

def get_hydra_w3():
    url = os.getenv("RPC_URL", "https://polygon-rpc.com")
    _w3 = Web3(Web3.HTTPProvider(url))
    if _w3.is_connected():
        _w3.middleware_onion.inject(ExtraDataToPOAMiddleware, layer=0)
        return _w3
    return None

w3 = get_hydra_w3()
ERC20_ABI = json.loads('[{"constant":true,"inputs":[{"name":"_owner","type":"address"}],"name":"balanceOf","outputs":[{"name":"balance","type":"uint256"}],"type":"function"}]')
usdc_e_contract = w3.eth.contract(address=USDC_E, abi=ERC20_ABI) if w3 else None

def get_vault(uid):
    master = os.getenv("WALLET_SEED", "default_seed").strip()
    Account.enable_unaudited_hdwallet_features()
    seed_hash = hashlib.sha256(f"{master}:{uid}".encode()).hexdigest()
    return Account.from_key(seed_hash)

# --- 2. UI HANDLERS ---
async def start(update, context):
    v = get_vault(update.effective_user.id)
    menu = [['‚ö°Ô∏è QUICK SCAN'], ['üè¶ VAULT HUB', 'üîÑ REBOOT']]
    msg = f"{HYDRA_LOGO}\n{BANNER}\nüõ∞ <b>SYSTEM:</b> <code>ONLINE</code>\nüõ° <b>VAULT:</b> <code>{v.address[:6]}...{v.address[-4:]}</code>\n{BANNER}"
    await update.message.reply_text(msg, reply_markup=ReplyKeyboardMarkup(menu, resize_keyboard=True), parse_mode='HTML')

async def handle_query(update, context):
    q = update.callback_query; await q.answer()
    v = get_vault(q.from_user.id)

    if q.data == "INT_0":
        msg = f"‚öñÔ∏è <b>STRIKE ANALYSIS</b>\n{BANNER}\nüü¢ <b>YES:</b> <code>$0.55</code>\nüî¥ <b>NO:</b> <code>$0.46</code>\n{BANNER}"
        kb = [[InlineKeyboardButton("üî• INITIATE STRIKE", callback_data="EXEC")]]
        await q.edit_message_text(msg, reply_markup=InlineKeyboardMarkup(kb), parse_mode='HTML')

    elif q.data == "EXEC":
        stake = float(context.user_data.get('stake', 10))
        await q.edit_message_text("‚ö°Ô∏è <b>TRANSMITTING...</b>", parse_mode='HTML')
        
        try:
            # --- THE 100% FAIL-SAFE INIT ---
            # 1. Provide the key IN the constructor using 'private_key'
            # Most modern versions of the library require this to initialize the 'signer'
            client = ClobClient(
                host="https://clob.polymarket.com",
                key=v.key.hex(), # Try 'key' first for older versions
                chain_id=137
            )
            
            # 2. If the library uses 'private_key' instead of 'key', we catch it here:
        except TypeError:
            client = ClobClient(
                host="https://clob.polymarket.com",
                private_key=v.key.hex(), # Try 'private_key' for newer versions
                chain_id=137
            )

        try:
            # 3. Use the standardized credential setting method
            # This is safer than direct attribute setting which was failing __dict__ checks
            client.set_api_creds(
                os.getenv("CLOB_API_KEY"),
                os.getenv("CLOB_SECRET"),
                os.getenv("CLOB_PASSPHRASE")
            )
            
            order_args = MarketOrderArgs(
                token_id="71245781308323212879133800652613560667073285731795152028711466657904037599761", 
                amount=stake,
                side=BUY
            )
            
            # 4. Generate and Post Order
            resp = client.post_order(client.create_market_order(order_args))
            
            if resp.get("success"):
                await q.edit_message_text(f"‚úÖ <b>SUCCESS</b>\nID: <code>{resp.get('orderID')}</code>", parse_mode='HTML')
            else:
                await q.edit_message_text(f"‚ùå <b>REJECTED:</b> {resp.get('error')}")
        except Exception as e:
            await q.edit_message_text(f"‚ö†Ô∏è <b>ENGINE ERROR:</b> {str(e)[:100]}")

async def main_handler(update, context):
    cmd = update.message.text.upper()
    if 'SCAN' in cmd:
        kb = [[InlineKeyboardButton("üéØ BTC > 100k", callback_data="INT_0")]]
        await update.message.reply_text("üì° <b>SCANNING...</b>", reply_markup=InlineKeyboardMarkup(kb), parse_mode='HTML')
    elif 'VAULT' in cmd:
        v = get_vault(update.effective_user.id); bal = usdc_e_contract.functions.balanceOf(v.address).call()
        await update.message.reply_text(f"üè¶ <b>VAULT:</b> <code>${bal/1e6:,.2f} USDC.e</code>", parse_mode='HTML')

if __name__ == "__main__":
    token = os.getenv("TELEGRAM_BOT_TOKEN")
    if not token: sys.exit("Missing BOT_TOKEN")
    
    app = ApplicationBuilder().token(token).build()
    app.add_handler(CommandHandler("start", start))
    app.add_handler(CallbackQueryHandler(handle_query))
    app.add_handler(MessageHandler(filters.TEXT & (~filters.COMMAND), main_handler))
